package com.yskj.models;import com.yskj.aop.StorageChild;import com.yskj.models.auth.User;import jdk.nashorn.internal.ir.annotations.Ignore;import lombok.Data;//表名称 partneruser@Datapublic class PartnerUser extends BaseEntity {	private static final long serialVersionUID = 1L;	public PartnerUser() {		super();	}	    //当前用户ID    private String userID;    //合伙人ID    private String partID;    //哪个分享过来的    private String shareID;    //启动还是未启动    private Boolean status;    //邀请码    private String code;    //升级后的partID    private String upgradePartID;    private String tempCode;    @Ignore    private Partner partner;    @StorageChild(refColumn = "userID")    private User user;}